@salvatopo A me sono nati 2 gemelli sani nel 2020, ho trovato un nuovo lavoro in 40 giorni, non mi posso lamentare.
Il 2021 bruttarello, invece quest'anno ho iniziato lo smartworking e ho avuto più tempo, più relax e meno spese.
